export default function Home(props){
    return( 
        props.movie.filter((mov,i)=>{
            return (
                <div key={i}>
                    <p>{mov.Title}</p>
                    <img src={mov.Image} />
                    <p>{mov.Description}</p>
                </div>
            )
        })
    )
}
